<p>给定一个带整数键值的链表 <strong>L</strong>，你需要把其中绝对值重复的键值结点删掉。即对每个键值 <strong>K</strong>，只有第一个绝对值等于 <strong>K</strong> 的结点被保留。同时，所有被删除的结点须被保存在另一个链表上。例如给定 <strong>L</strong> 为 21→-15→-15→-7→15，你需要输出去重后的链表 21→-15→-7，还有被删除的链表 -15→15。</p>
